import React, { useState, useEffect } from 'react';
import { ReactDagEditor } from 'react-dag-editor'; 

const LineagePage = () => {
  const [dagData, setDagData] = useState({
    nodes: [],
    links: []
  });

  const [settings, setSettings] = useState(null);  // Use state to track settings

  useEffect(() => {
    // Fetch data from backend
    fetch('http://127.0.0.1:3000/lineage/model_1')
      .then((response) => response.json())
      .then((data) => {
        const nodes = data.dependencies.map((dep) => ({
          id: dep,
          label: dep.charAt(0).toUpperCase() + dep.slice(1),
        }));

        const links = data.dependencies.map((dep) => ({
          source: data.model,
          target: dep,
        }));

        setDagData({
          nodes: [{ id: data.model, label: data.model }],  // Add current model node
          links: links,
        });

        // Initialize settings after data is fetched
        setSettings({
          zoom: true,
          pan: true,
          nodeWidth: 100,
          nodeHeight: 50,
        });
      })
      .catch((error) => console.error('Error fetching DAG data:', error));
  }, []);

  if (!settings) {
    return <div>Loading...</div>; // Return a loading state if settings are not available
  }

  return (
    <div>
      <h1>Lineage</h1>
      <ReactDagEditor
        nodes={dagData.nodes}
        links={dagData.links}
        settings={settings} // Ensure settings are passed when available
      />
    </div>
  );
};

export default LineagePage;
